query DiscussionComments_ReactionViewerLazyQuery(
  $id: ID!
) {
  node(id: $id) {
    __typename
    ... on Commit {
      comments(last: 60) {
        nodes {
          id
          ...MarkdownEditHistoryViewer_comment
          ...ReactionViewerGroups
        }
      }
    }
    id
  }
}

fragment MarkdownEditHistoryViewer_comment on Comment {
  __isComment: __typename
  id
  viewerCanReadUserContentEdits
  lastEditedAt
  lastUserContentEdit {
    editor {
      __typename
      url
      login
      id
    }
    id
  }
}

fragment ReactionButton_Reaction on ReactionGroup {
  content
  reactors(first: 5) {
    nodes {
      __typename
      ... on User {
        login
        __typename
      }
      ... on Bot {
        login
        __typename
      }
      ... on Organization {
        login
        __typename
      }
      ... on Mannequin {
        login
        __typename
      }
      ... on Node {
        __isNode: __typename
        id
      }
    }
    totalCount
  }
  viewerHasReacted
}

fragment ReactionViewerGroups on Reactable {
  __isReactable: __typename
  reactionGroups {
    ...ReactionButton_Reaction
    ...ReactionsMenuItem_Reaction
  }
}

fragment ReactionsMenuItem_Reaction on ReactionGroup {
  content
  viewerHasReacted
}
